import styled from "styled-components";

export const HomeHeader = styled.header`
  width: 100%;
  height: 80px;
  border: 0 0 10 solid white;
  display: flex;
  align-items: center;
  justify-content: space-around;

  button {
    width: 3%;
    height: 32px;
    border: none;
    border-radius: 5px;
  }
`;
